import React from "react"

const SignUp = React.forwardRef(({ style, ...rest }, ref) => {

    const styles = {
      ...style,
      background: 'white',
      width: "20rem",
      height: "23rem",
      padding: 15,
      borderRadius: 4,
      border:"1px solid #407BC4",
      position: 'absolute',
      boxShadow: '0 3px 6px -2px rgba(0, 0, 0, 0.6)',
      marginLeft: "-10%",
      marginTop: "-10%"
    };

    return (
      <div {...rest} style={styles} ref={ref}>
        <h2>Create an Account</h2>
        <form>
            <input
                className="inputForm"
            />
        </form>
      </div>
    );
  });

export default SignUp
